export const AnchorToButton: Story<ToastProps & ToasterSettings> = ({
  content,
  duration,
  hasCloseButton,
  link,
  type,
  onRemove,
  placement,
  order,
}) => {
  const buttonRef = React.useRef(null);
  const displayPositiveToast = () => {
    toaster.setSettings({
      placement: placement ?? 'top',
      order: order ?? 'descending',
    });
    toaster.positive(content, {
      duration,
      hasCloseButton,
      link,
      type,
      onRemove,
      animateOutTo: buttonRef.current,
    });
  };

  return (
    <>
      <Button
        ref={buttonRef}
        styleType='high-visibility'
        onClick={displayPositiveToast}
      >
        Positive
      </Button>
      <Button
        style={{ display: 'block', marginTop: 16 }}
        onClick={() => toaster.closeAll()}
      >
        Close All
      </Button>
    </>
  );
};

AnchorToButton.args = {
  content: 'This is a positive toast message',
};

export const CloseIndividual: Story<ToastProps & ToasterSettings> = ({
  duration,
  hasCloseButton,
  link,
  type,
  onRemove,
  placement,
  order,
}) => {
  const displayProcessToast = () => {
    toaster.setSettings({
      placement: placement ?? 'top',
      order: order ?? 'descending',
    });
    const { close } = toaster.informational(
      <div
        style={{
          display: 'flex',
          flexDirection: 'row',
          alignItems: 'flex-end',
        }}
      >
        <ProgressRadial
          size={'small'}
          indeterminate
          style={{ marginRight: '8px' }}
        />
        Your process is running...
      </div>,
      {
        duration,
        hasCloseButton,
        link,
        type,
        onRemove,
      },
    );

    setTimeout(() => {
      close();
      toaster.positive('Process completed', {
        duration,
        hasCloseButton,
        link,
        type: 'temporary',
        onRemove,
      });
    }, 3000);
  };

  return (
    <>
      <Button styleType='high-visibility' onClick={displayProcessToast}>
        Start process
      </Button>
    </>
  );
};

CloseIndividual.args = {
  type: 'persisting',
};
